import React from 'react';

export type StudentDataTypeNew =  {
    titleData: TitleDataType
    studentData: Array<StudentDataType>
}

export type StudentDataType =  {
    id: number
    name: string
    age: number
    skill: string
    title: string
}
export type TitleDataType =  {
    title: string
}


export const Students = (props: StudentDataTypeNew) => {

    return (
        <div>
            <h1>{props.titleData}</h1>
            <ul>
                <li>{props.studentData[0].name}</li>
                <li>{props.studentData[1].name}</li>
            </ul>
        </div>
    );
};
